import vimeo from "vimeo";

const useVimeo = () => {
  let client = new Vimeo("{client_id}", "{client_secret}", "{access_token}");

  client.request(
    {
      method: "GET",
      path: "/tutorial"
    },
    function(error, body, status_code, headers) {
      if (error) {
        console.log(error);
      }

      console.log(body);
    }
  );
};

export default useVimeo;
